import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      races: [
        {
          name: "Genasi"
        },
        {
          name: "Dragonborn"
        },
        {
          name: "Goliath"
        },
        {
          name: "Aasimar"
        }
      ]
    }
  }

  render() {
    return (
        <div className="App">
          {
            this.state.races.map(race => <h1> { race.name } </h1>)
          }

        </div>
      );
  }
}

export default App;
